      <p class="Body-Copy" id="u10380-2">ACS Rotech is a Perth based company that manufactures and supplies cost effective vehicle cleaning products and services to clients in the Automotive, Transport and Mining industries in WA. We not only supply a range of high performance cleaning products, we also build and supply complete wash bays that include high pressure cleaning systems, spot free car washing systems, ducted vacuum systems and oil-water separation units.</p>
